) {\n                label('Сценарий')\n                uiControl(FormFieldType.COMBOBOX)\n                type(ValueType.INT)\n                required()\n                items { params ->\n                    sql.rows("SELECT id, name FROM plans WHERE parent_id IS NULL AND type = 'user' ORDER BY name")\n                }\n            }\n            param('spend') {\n                label('Включение приходных статей')\n                uiControl(FormFieldType.COMBOBOX)\n                type(ValueType.INT)\n                defaultValue(0)\n                optional()\n                items{ params ->\n                    sql.rows("SELECT 1 as id, 'Да' as name UNION SELECT 0 as id, 'Нет' as name")\n                }\n            }\n        }\n    }\n}|TMS
