plan_fact|report.groovy|package Reports.plan_fact\n\nimport custis.cbr.reportgen.engine.core.ContentType\nimport custis.cbr.reportgen.engine.core.ModelAndView\nimport custis.cbr.reportgen.engine.core.ReportContext\nimport custis.cbr.reportgen.engine.core.TemplateType\nimport custis.cbr.reportgen.engine.groovy.ReportGenerator\nimport custis.cbr.reportgen.reports.utils.StdFunctions\nimport groovy.sql.Sql\nimport org.apache.commons.lang.StringUtils\n\nimport java.sql.Date\nimport java.util.function.Predicate\n\nimport static custis.cbr.reportgen.reports.groovy.dsl.ReportGeneratorDSL.processTemplate\nimport static custis.cbr.reportgen.reports.groovy.dsl.ReportGeneratorDSL.templateParams\n\nclass Report implements ReportGenerator {\n\n    public static final String QUERY = """SELECT\n          sq.cost_center_id,\n          sq.cost_center_name,\n          sq.funding_date,\n          coalesce(sq.plan, 0) plan,\n          coalesce(sq.fact, 0) fact,\n          coalesce(sq.deviation, 0) deviation,\n          bi.id budget_item_id,\n          bi.name budget_item_name,\n          sq.comment,\n          sq.paytype_id,\n          bi.code budget_item_code,\n          bi.parent_id,\n          sq.paytype_name,\n          bi.skip_znvf\n        FROM\n          budget_items bi\n          FULL OUTER JOIN\n          (SELECT\n             coalesce(positions_q.cost_center_id, payments_q.cost_center_id)     cost_center_id,\n             coalesce(positions_q.cost_center_name, payments_q.cost_center_name) cost_center_name,\n             coalesce(positions_q.funding_date, payments_q.funding_date)         funding_date,\n             coalesce(positions_q.plan, 0)                                       plan,\n             coalesce(payments_q.fact, 0)                                        fact,\n             coalesce(payments_q.fact, 0) - coalesce(positions_q.plan, 0)        deviation,\n             coalesce(positions_q.budget_item_id, payments_q.budget_item_id)     budget_item_id,\n             coalesce(positions_q.paytype_id, payments_q.paytype_id)             paytype_id,\n             coalesce(positions_q.paytype_name, payments_q.paytype_name)         paytype_name,\n             positions_q.comment\n           FROM\n             (SELECT\n                cs.id                           AS cost_center_id,\n                cs.name                         AS cost_center_name,\n                pos.date                        AS funding_date,\n                abs(SUM(pos.total))             AS plan,\n                bi.id                           AS budget_item_id,\n                pos.propdata ->> 'fact_comment' AS comment,\n                pay.id                          AS paytype_id,\n                pay.name                        AS paytype_name\n              FROM positions pos\n                LEFT JOIN budget_items bi ON (bi.id = pos.line_id)\n                LEFT JOIN cost_centers cs ON (pos.cfo_id = cs.id)\n                LEFT JOIN paytypes pay ON (pos.paytype_id = pay.id)\n              WHERE pos.date BETWEEN :funding_period_from AND :funding_period_til AND pos.plan_id = :plan AND %s\n              GROUP BY cost_center_id, cost_center_name, funding_date, budget_item_id, comment, pay.id\n             ) positions_q\n             FULL OUTER JOIN\n             (\n               SELECT\n                 cs.id           AS cost_center_id,\n                 cs.name         AS cost_center_name,\n                 e.date          AS funding_date,\n                 SUM(paym.total) AS fact,\n                 bi.id           AS budget_item_id,\n                 pay.id          AS paytype_id,\n                 pay.name        AS paytype_name\n               FROM payments paym\n                 LEFT JOIN budget_items bi ON (bi.id = paym.line_id)\n                 LEFT JOIN cost_centers cs ON (paym.cfo_id = cs.id)\n                 INNER JOIN events e ON (e.payment_id = paym.id)\n                 INNER JOIN states s ON (paym.status_id = s.id)\n                 LEFT JOIN paytypes pay ON (pay.id = paym.paytype_id)\n               WHERE e.date BETWEEN :funding_period_from AND :funding_period_til AND upper(s.name) = upper('исполнен') AND %s\n               GROUP BY cost_center_id, cost_center_name, funding_date, budget_item_id, pay.id\n             ) payments_q\n               ON (positions_q.cost_center_id = payments_q.cost_center_id AND\n                   positions_q.funding_date = payments_q.funding_date AND\n                   positions_q.budget_item_id = payments_q.budget_item_id AND\n                   positions_q.paytype_id = payments_q.paytype_id)) sq\n            ON (bi.id = sq.budget_item_id)\n        ORDER BY cost_center_name, funding_date, budget_item_code"""\n\n    @Override\n    ModelAndView generate(Map<String, Object> parameters, ReportContext ctx) {\n        StringBuilder where = new StringBuilder();\n        where.append(constructWhereClausePart('organization', 'cs.id', parameters))\n             .append(" AND ")\n             .append(constructSpendWhereClause('spend', 'bi.spend', parameters));\n        String orgWhereClausePart = where.toString();\n\n        def query = String.format(QUERY, orgWhereClausePart, orgWhereClausePart);\n\n        Sql sql = new Sql(ctx.getDefaultDS())\n        def data = sql.rows(query, [funding_period_from: parameters['funding_period_from'], funding_period_til: parameters['funding_period_til'], plan: parameters['plan']]);\n        if (data.empty) {\n            return StdFunctions.noData {\n                "Не найдены данные, удовлетворяющие введенным значениям параметров формирования."\n            };\n        }\n\n        def filteredData = applyFilter(data);\n        if (filteredData.empty) {\n            return StdFunctions.noData {\n                "Не найдены данные, удовлетворяющие введенным значениям параметров формирования."\n            };\n        }\n\n        def groupedData = applyGrouping(filteredData)\n\n        processTemplate(ctx, TemplateType.VELOCITY, 'template.vm', ContentType.HTML) {\n            templateParams(\n                    report: groupedData,\n                    parameters: parameters\n            )\n        }\n    }\n\n    private static List<Map<String, Object>> applyFilter(List<Map<String, Object>> data) {\n        Map<Long, List<Integer>> graph = constructGraph(data);\n        List<Long> rootIdxs = findRoots(data);\n\n        for (Integer rootIdx : rootIdxs) {\n            getChildrenPaytypes(graph, data, rootIdx);\n        }\n\n        data.removeIf(new Predicate<Map<String, Object>>() {\n            @Override\n            boolean test(Map<String, Object> row) {\n                BigDecimal fact = row.get('fact') as BigDecimal\n\n                if (fact > 0) {\n                    return false\n                }\n\n                Integer skipZnvf = row.get('skip_znvf') as Integer;\n                if (skipZnvf == 1) {\n                    return true\n                }\n\n                return !row.containsKey('keep_node') || row.get('keep_node') == false\n            }\n        })\n\n        return data\n    }\n\n    private static Set<Long> getChildrenPaytypes(Map<Long, List<Integer>> graph, List<Map<String, Object>> data, int idx) {\n        Map<String, Object> node = data.get(idx);\n        Long budgetItemId = node.get('budget_item_id') as Long\n\n        Set<Long> paytypes = new HashSet<>();\n        List<Integer> children = graph.get(budgetItemId);\n        for (Integer child : children) {\n            Map<String, Object> childNode = data.get(child);\n            if (isSameCfoAndDateForParentAndChild(childNode, node)) {\n                Set<Long> childrenPaytypes = getChildrenPaytypes(graph, data, child);\n                paytypes.addAll(childrenPaytypes)\n            }\n        }\n        BigDecimal plan = node.get('plan') as BigDecimal\n        if (plan > 0) {\n            Long paytypeId = node.get('paytype_id') as Long;\n            if (paytypeId == null) {\n                node.put('keep_node', paytypes.isEmpty() && siblingsPaytypesAreEmpty(node, idx, graph, data))\n            } else {\n                node.put('keep_node', !paytypes.contains(paytypeId))\n            }\n\n            paytypes.add(paytypeId)\n        } else {\n            node.put('keep_node', false)\n        }\n        return paytypes;\n    }\n\n    private static boolean siblingsPaytypesAreEmpty(Map<String, Object> node, Integer nodeIdx, Map<Long, List<Integer>> graph, List<Map<String, Object>> data) {\n        Long parentId = node.get('parent_id') as Long;\n        List<Integer> siblings = graph.get(parentId);\n        boolean result = true;\n\n        for (Integer siblingIdx : siblings) {\n            if (siblingIdx == nodeIdx) {\n                continue;\n            }\n\n            Map<String, Object> sibling = data.get(siblingIdx);\n            if (!isSameCfoAndDateAndBudgetItem(sibling, node)) {\n                continue;\n            }\n\n            BigDecimal plan = sibling.get('plan') as BigDecimal;\n            BigDecimal paytype = sibling.get('paytype_id') as Long;\n            if (plan > BigDecimal.ZERO && paytype != null) {\n                return false;\n            }\n        }\n\n        return result;\n    }\n\n    private static boolean isSameCfoAndDateAndBudgetItem(Map<String, Object> node1, Map<String, Object> node2) {\n        Long cfoId1 = node1.get('cost_center_id') as Long\n        Long budgetItemId1 = node1.get('budget_item_id') as Long\n        Date fundingDate1 = node1.get('funding_date') as Date\n\n        Long cfoId2 = node2.get('cost_center_id') as Long\n        Long budgetItemId2 = node2.get('budget_item_id') as Long\n        Date fundingDate2 = node2.get('funding_date') as Date\n\n        return cfoId1 == cfoId2 && fundingDate1 == fundingDate2 && budgetItemId1 == budgetItemId2\n    }\n\n    private static boolean isSameCfoAndDateForParentAndChild(Map<String, Object> childNode, Map<String, Object> parentNode) {\n        Long cfoId1 = childNode.get('cost_center_id') as Long\n        Date fundingDate1 = childNode.get('funding_date') as Date\n\n        Long cfoId2 = parentNode.get('cost_center_id') as Long\n        Date fundingDate2 = parentNode.get('funding_date') as Date\n\n        if (cfoId2 == null || fundingDate2 == null) {\n            return true;\n        }\n\n        return cfoId1 == cfoId2 && fundingDate1 == fundingDate2\n    }\n\n    private static Map<Long, List<Integer>> constructGraph(List<Map<String, Object>> data) {\n        Map<Long, List<Integer>> result = new HashMap<>();\n        for (int i = 0; i < data.size(); i++) {\n            Long budgetItemId = data.get(i).get('budget_item_id') as Long\n            if (!result.containsKey(budgetItemId)) {\n                result.put(budgetItemId, new ArrayList<Integer>())\n            }\n\n            Long parentBudgetItemId = data.get(i).get('parent_id') as Long\n            if (parentBudgetItemId != null) {\n                Integer budgetItemIdx = i;\n\n                if (!result.containsKey(parentBudgetItemId)) {\n                    result.put(parentBudgetItemId, new ArrayList<Integer>())\n                }\n                List<Integer> childrenOfParentBudgetItem = result.get(parentBudgetItemId);\n                childrenOfParentBudgetItem.add(budgetItemIdx);\n            }\n        }\n\n        return result;\n    }\n\n    private static List<Integer> findRoots(List<Map<String, Object>> data) {\n        List<Integer> result = new ArrayList<>();\n        for (int i = 0; i < data.size(); i++) {\n            Map<String, Object> row = data.get(i);\n            if (row.get('parent_id') == null) {\n                result.add(i);\n            }\n        }\n        return result;\n    }\n\n    private static List<Map<String, Object>> applyGrouping(List<Map<String, Object>> data) {\n        def index = 0;\n        def currentGroupOrgId = null;\n        def currentGroupFundingDate = null;\n        def planSum = 0;\n        def factSum = 0;\n        def deviationSum = 0;\n        List<Map<String, Object>> result = new ArrayList<>();\n        for (Map<String, Object> row : data) {\n            def fundingDate = row.get('funding_date')\n            def cfoId = row.get('cost_center_id')\n            if (currentGroupOrgId != cfoId || fundingDate != currentGroupFundingDate) {\n                if (index != 0) {\n                    result.add(constructSubTotals(planSum, factSum, deviationSum));\n                }\n                planSum = 0;\n                factSum = 0;\n                deviationSum = 0;\n                currentGroupFundingDate = fundingDate;\n                currentGroupOrgId = cfoId;\n            }\n\n            row.put('subTotalRow', false);\n            result.add(row);\n\n            planSum += row.get('plan');\n            factSum += row.get('fact');\n            deviationSum += row.get('deviation');\n            index++;\n        }\n        if (currentGroupOrgId != null && currentGroupFundingDate != null) {\n            result.add(constructSubTotals(planSum, factSum, deviationSum));\n        }\n\n        return result;\n    }\n\n    private static Map<String, Object> constructSubTotals(planSum, factSum, deviationSum) {\n        return new HashMap<String, Object>() {{\n            put("cost_center_name", StringUtils.capitalize('итого'));\n            put("plan", planSum)\n            put("fact", factSum)\n            put("deviation", deviationSum)\n            put('subTotalRow', true);\n        }};\n    }\n\n\n    private static String constructSpendWhereClause(String paramName, String sqlObjName, Map<String, Object> parameters) {\n        def result = '1=1';\n        def spend = parameters[paramName];\n        if (spend == 0 || (spend == null || ((String)spend).isEmpty())) {\n            result = String.format('%s != 1', sqlObjName);\n        }\n        result\n    }\n\n    private static String constructWhereClausePart(String paramName, String sqlObjName, Map<String, Object> parameters) {\n        def statusWhereClausePart;\n        def status = parameters[paramName];\n        if (status instanceof List) {\n            statusWhereClausePart = String.format('%s IN (%s)', sqlObjName, ((List) status).join(","));\n        } else if (status == null || ((String)status).isEmpty()) {\n            statusWhereClausePart = '(1 = 1)';\n        } else {\n            statusWhereClausePart = String.format('%s = %s', sqlObjName, status);\n        }\n        statusWhereClausePart\n    }\n}|TMS
znvf|report.groovy|package Reports.znvf\n\nimport custis.cbr.reportgen.engine.core.*\nimport custis.cbr.reportgen.engine.groovy.ReportGenerator\nimport custis.cbr.reportgen.reports.utils.StdFunctions\nimport groovy.sql.GroovyRowResult\nimport groovy.sql.Sql\nimport org.apache.commons.lang.StringUtils\n\nimport static custis.cbr.reportgen.reports.groovy.dsl.ReportGeneratorDSL.processTemplate\nimport static custis.cbr.reportgen.reports.groovy.dsl.ReportGeneratorDSL.templateParams\n\nclass ReportZNVF implements ReportGenerator {\n\n    public static final String QUERY = """SELECT\n                  cc.name                            cost_center_name,\n                  l.code                             article_code,\n                  CASE\n                  WHEN (p.propdata->>'show_root')::integer = 1 THEN\n                    (WITH RECURSIVE bi_r(id, level, name, parent_id) AS (\n                      SELECT\n                        bi1.id,\n                        bi1.level,\n                        bi1.name,\n                        bi1.parent_id\n                      FROM budget_items AS bi1\n                      WHERE id = l.id\n                      UNION\n                      SELECT\n                        bi2.id,\n                        bi2.level,\n                        bi2.name,\n                        bi2.parent_id\n                      FROM budget_items AS bi2\n                        JOIN bi_r\n                          ON bi2.id = bi_r.parent_id\n                    )\n                    SELECT\n                      name || ' - ' || l.name\n                    FROM bi_r\n                    WHERE level = 1)\n                  ELSE\n                    l.name\n                  END                                article_name,\n                  pt.name                            paytype_name,\n                  string_agg(ca.num, ', ')           account_num,\n                  p.date,\n                  p.total,\n                  p.propdata :: JSON ->> 'comment'    AS comment,\n                  st.name                            status\n                FROM positions p\n                  INNER JOIN cost_hierarchy ch ON (p.cfo_id = ch.child_id)\n                  INNER JOIN budget_items l ON (p.line_id = l.id)\n                  LEFT JOIN org_struct os ON (os.cost_center_id = p.cfo_id)\n                  LEFT JOIN cp_accounts ca ON (ca.org_id = os.id AND ca.is_mpaccount = 'Y')\n                  LEFT JOIN paytypes pt ON (p.paytype_id = pt.id)\n                  LEFT JOIN states st ON (p.status_id = st.id)\n                  LEFT JOIN cost_centers cc ON (p.cfo_id = cc.id)\n                WHERE (p.plan_id = :plan_id) AND (p.date = :date) AND (ch.parent_id = :cfo_id) AND (p.party_id = -1) AND\n                      (p.account_id = -1) AND (p.total < 0)\n                GROUP BY cc.name, l.id, pt.name, p.date, p.total, p.propdata, st.name\n                ORDER BY l.code, l.name"""\n\n    public static final String ADDED_DATE_QUERY = """SELECT\n                  p.added                           added\n                FROM plans p\n                WHERE (p.id = :plan_id)"""\n\n    @Override\n    ModelAndView generate(Map<String, Object> parameters, ReportContext ctx) {\n        def query = QUERY\n        def addedQuery = ADDED_DATE_QUERY\n\n        Sql sql = new Sql(ctx.getDefaultDS())\n        def date = parameters['date']\n        def planId = parameters['plan_id']\n        def cfoId = parameters['cfo_id']\n        def data = sql.rows(query, [date: date, plan_id: planId, cfo_id: cfoId])\n        if (data.empty) {\n            return StdFunctions.noData {\n                String.format("""Не найдены данные, удовлетворяющие введенным значениям параметров формирования:\n                    Идентификатор сценария: %s;\n                    Идентификатор ЦФО: %s;\n                    Дата: %s;""", planId, cfoId, DateUtil.ddMMyyyyFormatDate(date))\n            }\n        }\n\n        def result = applyTotals(data)\n\n        def addedRows = sql.rows(addedQuery, [plan_id: planId])\n        if (addedRows.empty) {\n            return StdFunctions.noData {\n                String.format("""Не найден сценарий с идентификатором: %s;""", planId)\n            }\n        }\n\n        def addedDate = new Date(Long.valueOf(addedRows.get(0).getProperty('added') as String) * 1000L)\n\n        processTemplate(ctx, TemplateType.VELOCITY, 'template.vm', ContentType.HTML) {\n            templateParams(\n                    report: result,\n                    parameters: parameters,\n                    added: addedDate\n            )\n        }\n    }\n\n    private static List<Map<String, Object>> applyTotals(List<GroovyRowResult> data) {\n        List<Map<String, Object>> result = new ArrayList<>()\n        def sum = 0\n        for (GroovyRowResult row : data) {\n            sum += row.getProperty('total')\n\n            row.put('totals_row', false)\n            result.add(row)\n        }\n        result.add(new HashMap<String, Object>() {\n            {\n                put('cost_center_name', StringUtils.capitalize('итого'))\n                put('total', sum)\n                put('totals_row', true)\n            }\n        })\n\n        result\n    }\n}|TMS
